import React from 'react';
import './List.css';
import { Container, Button } from '../../globalStyles';
import { Link } from 'react-router-dom';

import {
  ProjObjOne,
  ProjOjbTwo,
  ProjOjbThree,
  ProjOjbFour,
} from "./Data";

export const List = () => {

  const primary = true
  const buttonLabel = 'Lulli'
  const link = '/'

  return (
    <div class='btn-group'>
     <Link to={{pathname: ProjObjOne.link}} target="_blank"><Button big fontBig primary={primary}>{ProjObjOne.title}</Button></Link>
     <Link to={link}><Button big fontBig primary={primary}>{buttonLabel}</Button></Link>
     <Link to={link}><Button big fontBig primary={primary}>{buttonLabel}</Button></Link>
     <Link to={link}><Button big fontBig primary={primary}>{buttonLabel}</Button></Link>
    </div>
  );
};
